	static int getDIA(boolean test){
		
		//-->  Somente Para Teste
		if(test){
			for(int mes=1;mes<=12; mes++)		
				for(int dia=1; dia <= 31; dia++)
					for(int i=0; i < FERIADOS.length; i++){
						int fday  = Integer.parseInt(FERIADOS[i][0]);
						int fmonth= Integer.parseInt(FERIADOS[i][1]);
						if(fday == dia && fmonth==mes)
								System.out.println(fday + "/" + fmonth + "\tFERIADO :"  + FERIADOS[i][2]);
						
					}			
			return 0;
		}
		//<--
		
		Calendar calendar = Calendar.getInstance();
		
		
		int day     = calendar.get(Calendar.DAY_OF_MONTH);
		int month   = calendar.get(Calendar.MONTH) + 1;
		int weekday = calendar.get(Calendar.DAY_OF_WEEK); 
        
		boolean isFeriado = false;
		for(int i=0; i < FERIADOS.length; i++){
			int fday  = Integer.parseInt(FERIADOS[i][0]);
			int fmonth= Integer.parseInt(FERIADOS[i][1]);
			if(fday == day && fmonth==month){
				isFeriado = true;
				System.out.println("FERIADO : " + FERIADOS[i][2]);
				break;
			}			
		}
		
		if(isFeriado)
			return 2;
		
		if(weekday == Calendar.SUNDAY)
			return 2;
		
		if(weekday == Calendar.SATURDAY)
			return 1;
		

		return 0;
	}

